import React from "react";
import { Card } from "react-bootstrap";
import { Link } from "react-router-dom";

const Iphone = (props) => {
  return (
    <>
      {props.phone.map((phone, id) => (
        <Link to={`/blogs/${phone.id}`} className="links">
          <div key={id}>
            <Card
              style={{ width: "12.4rem", border: `none`, marginBottom: `10px` }}
              className="card"
            >
              <img variant="top" src={props.phone.imgUrl} alt="imgUrl" />
              <Card.Body>
                <Card.Title> {props.phone.name}</Card.Title>
                <Card.Text>
                  <p>{props.phone.price}</p>
                </Card.Text>
              </Card.Body>
            </Card>
          </div>
          <Phone phone={phone} />
        </Link>
      ))}
    </>
  );
};
const mapStateToProps = (state) => {
  return { andriod: state.andriod };
};

export default Iphone;
